import { Admin, Resource, ShowGuesser, EditGuesser } from "react-admin";
//import jsonServerProvider from "ra-data-json-server";
import { UserList, UserEdit } from "./components/users";
//import simpleRestProvider from 'ra-data-simple-rest';

import { fetchUtils } from 'ra-core';

const apiUrl = 'https://se-diva-docs.herokuapp.com';

const httpClient = (url: any, options: fetchUtils.Options = {}) => {
  if (!options.headers) {
    options.headers = new Headers({ Accept: 'application/json' });
  }
  const token = localStorage.getItem('token');
  options.headers.set('Authorization', `Bearer ${token}`);
  return fetchUtils.fetchJson(url, options);
};

const dataProvider = {
  getList: (resource, params) =>
    fetchUtils.fetchJson(`${apiUrl}/${resource}?${stringify(params)}`).then(({ json }) => ({
      data: json,
      total: parseInt(json.length, 10),
    })),
  getOne: (resource, { id }) =>
    fetchUtils.fetchJson(`${apiUrl}/${resource}/${id}`).then(({ json }) => ({
      data: json,
    })),
  getMany: (resource, params) => {
    const query = {
      filter: JSON.stringify({ id: params.ids }),
    };
    return fetchUtils.fetchJson(`${apiUrl}/${resource}?${stringify(query)}`).then(({ json }) => ({
      data: json,
    }));
  },
  getManyReference: (resource, params) => {
    const query = {
      ...params.filter,
      [params.target]: params.id,
    };
    return fetchUtils.fetchJson(`${apiUrl}/${resource}?${stringify(query)}`).then(({ json }) => ({
      data: json,
      total: json.length,
    }));
  },
  create: (resource, { data }) =>
    fetchUtils.fetchJson(`${apiUrl}/${resource}`, {
      method: 'POST',
      body: JSON.stringify(data),
    }).then(({ json }) => ({
      data: { ...data, id: json.id },
    })),
  update: (resource, { id, data }) =>
    fetchUtils.fetchJson(`${apiUrl}/${resource}/${id}`, {
      method: 'PUT',
      body: JSON.stringify(data),
    }).then(({ json }) => ({
      data: json,
    })),
  updateMany: (resource, params) => {
    const query = {
      filter: JSON.stringify({ id: params.ids }),
    };
    return fetchUtils.fetchJson(`${apiUrl}/${resource}?${stringify(query)}`, {
      method: 'PUT',
      body: JSON.stringify(params.data),
    }).then(({ json }) => ({
      data: json,
    }));
  },
  delete: (resource, { id }) =>
    fetchUtils.fetchJson(`${apiUrl}/${resource}/${id}`, {
      method: 'DELETE',
    }).then(({ json }) => ({
      data: json,
    })),
  deleteMany: (resource: any, params: any) => {
    const query = {
      filter: JSON.stringify({ id: params.ids }),
    };
    return fetchUtils.fetchJson(`${apiUrl}/${resource}?${stringify(query)}`, {
      method: 'DELETE',
    }).then(({ json }) => ({
      data: json,
    }));
  },
};



//const dataProvider = jsonServerProvider('https://se-diva-docs.herokuapp.com');
//const dataProvider = simpleRestProvider('https://se-diva-docs.herokuapp.com');
console.log(dataProvider)

const App = () => (
  <Admin dataProvider={dataProvider}>
    <Resource name="applicants/view" list={UserList} edit={UserEdit} show={ShowGuesser}/>
  </Admin>
);


export default App;
